import { BrowserRouter, Route, Routes } from "react-router-dom";
import React from 'react';
import Calendar from "./routes/Calendar";
import Login from "./routes/Login";
import Join from "./routes/Join";
import DesignPage from "./routes/DesignPage";
import WritingPage from "./routes/WritingPage";
import Profile from "./routes/Profile";

const App : React.FC = () => {
  return (
    <BrowserRouter>
      <Routes>    
       <Route path="/" element={<Login />} />
       <Route path="/join" element={<Join />} />
       <Route path="/calender/:id" element={<Calendar />} />
       <Route path="/design/:id" element={<DesignPage />} />
       <Route path="writing/:id" element={<WritingPage />} />
       <Route path="/profile/:id" element={<Profile/>} />
      </Routes>
    </BrowserRouter>
  );
}



export default App;
